import React from 'react';
import {Signup} from "./components/signup";
import {Signin} from "./components/signin"
import {Link} from "react-router-dom";
import {Route, Router, Switch} from "react-router";

function App() {
  return (
      <Router>
          <Switch>
              <Route>
                  <Signup/>
              </Route>
          </Switch>


          <Signin/>
      </Router>

  );
}

export default App;
